(432,'{\"textArea\":\"\\u003ch2 style\\u003d\\\"text-align: center;\\\"\\u003e\\u003cstrong\\u003eCreative Concepts I\\u003c/strong\\u003e\\u003c/h2\\u003e\\r\\n\\u003cp\\u003eTitle: Mark Smith\\u003c/p\\u003e\\r\\n\\u003cp\\u003eLength: 30\\u003c/p\\u003e\\r\\n\\u003cp\\u003eScript:\\u0026nbsp;\\u003c/p\\u003e\\r\\n\\u003cp\\u003eHi I\\u0026rsquo;m Mark Smith, owner of Premium Auto Service Centers\\u0026hellip;and each and every day our community has critical needs for more than 400 donations of blood.\\u0026nbsp; One donation of blood can save 3 lives.\\u0026nbsp; We\\u0026rsquo;ve teamed up with (local blood donation center) to help our community.\\u0026nbsp; From now until (date) when you donate blood you\\u0026rsquo;ll get a free oil change from Premium Auto Centers.\\u0026nbsp; That\\u0026rsquo;s right\\u0026hellip;give us a small amount of your fluids and we will give you ours.\\u0026nbsp; Go to (website) for more information on donations center hours and how to sign up.\\u0026nbsp; Premium Auto Centers\\u0026hellip;taking care of you, your car and our community.\\u0026nbsp;\\u003c/p\\u003e\"}',37,'CreateConceptOnePage',25,0),
(433,'{\"textArea\":\"\\u003ch2 style\\u003d\\\"text-align: center;\\\"\\u003e\\u003cstrong\\u003e Creative Concepts II\\u003c/strong\\u003e\\u003c/h2\\u003e\\r\\n\\u003cp\\u003eTitle: Mark Smith 2\\u003c/p\\u003e\\r\\n\\u003cp\\u003eLength: 30\\u0026nbsp;\\u003c/p\\u003e\\r\\n\\u003cp\\u003eScript:\\u0026nbsp;\\u003c/p\\u003e\\r\\n\\u003cp\\u003eHi, I\\u0026rsquo;m Mark Smith\\u0026hellip;owner of Premium Auto Centers and I recently learned that 18% of the children in our community are chronically hungry\\u0026hellip;that means that they do not know where their next meal is coming from.\\u0026nbsp; While we can\\u0026rsquo;t solve all the world\\u0026rsquo;s problems\\u0026hellip;I am committed to making a difference in our own backyard.\\u0026nbsp; That\\u0026rsquo;s why from now through (date) visit any of our 4 Premium Auto Center locations and make a $10 donation to the FoodBank and I will give you a free oil change.\\u0026nbsp; That\\u0026rsquo;s right a donation of $10 gets you a $30 value oil change and a 45 point courtesy check.\\u0026nbsp; Premium Auto Centers\\u0026hellip;taking care of you, your car and our community.\\u0026nbsp;\\u003c/p\\u003e\"}',37,'CreateConceptTwoPage',26,0),
