(459,'{\"textArea\":\"\\u003ch2 style\\u003d\\\"text-align: center;\\\"\\u003e\\u003cstrong\\u003eMarketing Strategies\\u003c/strong\\u003e\\u003c/h2\\u003e\\r\\n\\u003cp\\u003eTo help \\u003cstrong\\u003echange consumer attitudes \\u003c/strong\\u003eabout automotive service (a lack of trust), I would encourage you to be featured in all commercials.\\u0026nbsp; No one can better represent the trust and expertise that you offer.\\u0026nbsp; This will also highlight the benefits of local ownership backed by the national Premium brand franchise\\u003c/p\\u003e\\r\\n\\u003cp\\u003eTo \\u003cstrong\\u003eexpand your target market \\u003c/strong\\u003eto the largest potential market, focus the creative in your campaigns around the primary drivers of automotive service, which include oil changes and state inspections.\\u0026nbsp; While in the store, you can individually sell other needed services such as tires, brakes, etc.\\u003c/p\\u003e\\r\\n\\u003cp\\u003eFocus on the outstanding customer experience and the customer service guarantee that will separate yourselves from the competition.\\u0026nbsp;\\u003c/p\\u003e\\r\\n\\u003cp\\u003eTo \\u003cstrong\\u003eenhance your image in the market\\u003c/strong\\u003e, form partnerships with local non-profits in cause marketing campaigns that will make a difference in the community\\u003c/p\\u003e\\r\\n\\u003cp\\u003eSponsor blood drives at your locations, whereas with a donation of blood each patron receives a free oil change.\\u0026nbsp; This provides a triple win helping to drive new donations, providing a value added for blood donors and for Midas it will increase the potential customer base while providing an outstanding community service (saving lives).\\u0026nbsp;\\u003c/p\\u003e\\r\\n\\u003cp\\u003eTo encourage donations to the local Food Bank, consider offering a free oil change ($30 value) for every $10 donation inspection.\\u0026nbsp; This will not only help to feed hungry children, it will also promote goodwill in the community while building repeat business.\\u003c/p\\u003e\\r\\n\\u003cp\\u003eTo attract more qualified candidates, create a recruitment campaign with your voicing, targeting candidates with the precise tech specifications you are seeking, but heavily promoting your distinct advantages (ex. higher pay, more comprehensive benefits, growth potential, etc.). Your target market is not the \\u0026ldquo;unemployed,\\u0026rdquo; but those currently working, but not totally fulfilled in their given position.\\u0026nbsp;\\u003c/p\\u003e\"}',38,'MarketingStrategiesPage',31,0),
