(520,'{\"firstTierBusiness\":\"Midas\",\"secondTierBusiness\":\"Firestone Service Centers\",\"thirdTierBusiness\":\"Jiffy Lube\",\"fourthTierBusiness\":\"Billy Bob\\u0027s Neighborhood Service Center\",\"competitionA\":\"Midas\",\"competitionB\":\"Firestone Service Centers\",\"competitionStrengthA\":\"Firestone has a national reputation and a large advertising budget and 4 locations.  \",\"competitionStrengthB\":\"While known primarily for tires, Firestone has rebranded itself as a full automotive repair center.\",\"competitionWeaknessA\":\"While they do total car care Midas is still known primarily for Mufflers.\",\"competitionWeaknessB\":\"Locally Firestone has not done a good job of standing behind their work and has a mixed reputation.\"}',42,'MarketPlaceCompetitionPage',3,0),
