(791,'{\"textArea\":\"\\u003ch1 style\\u003d\\\"text-align: center; padding-top: 2%;\\\"\\u003eCreative Concepts I\\u003c/h1\\u003e\\r\\n\\u003cp\\u003eTitle:\\u003c/p\\u003e\\r\\n\\u003cp\\u003eLength:\\u003c/p\\u003e\\r\\n\\u003cp\\u003eScript:\\u003c/p\\u003e\\r\\n\\u003cp\\u003eHi I\\u0026rsquo;m Mark Smith, owner of Premium Auto Service Centers\\u0026hellip;and each and every day our community has critical needs for more than 400 donations of blood.\\u0026nbsp; One donation of blood can save 3 lives.\\u0026nbsp; We\\u0026rsquo;ve teamed up with (local blood donation center) to help our community.\\u0026nbsp; From now until (date) when you donate blood you\\u0026rsquo;ll get a free oil change from Premium Auto Centers.\\u0026nbsp; That\\u0026rsquo;s right\\u0026hellip;give us a small amount of your fluids and we will give you ours.\\u0026nbsp; Go to (website) for more information on donations center hours and how to sign up.\\u0026nbsp; Premium Auto Centers\\u0026hellip;taking care of you, your car and our community.\\u0026nbsp;\\u003c/p\\u003e\"}',78,'CreateConceptOnePage',25,0),
(792,'{\"textArea\":\"\\u003ch1 style\\u003d\\\"text-align: center; padding-top: 2%;\\\"\\u003eCreative Concepts II\\u003c/h1\\u003e\\r\\n\\u003cp\\u003eTitle:\\u003c/p\\u003e\\r\\n\\u003cp\\u003eLength:\\u003c/p\\u003e\\r\\n\\u003cp\\u003eScript:\\u003c/p\\u003e\\r\\n\\u003cp\\u003eHi, I\\u0026rsquo;m Mark Smith\\u0026hellip;owner of Premium Auto Centers and I recently learned that 18% of the children in our community are chronically hungry\\u0026hellip;that means that they do not know where their next meal is coming from.\\u0026nbsp; While we can\\u0026rsquo;t solve all the world\\u0026rsquo;s problems\\u0026hellip;I am committed to making a difference in our own backyard.\\u0026nbsp; That\\u0026rsquo;s why from now through (date) visit any of our 4 Premium Auto Center locations and make a $10 donation to the FoodBank and I will give you a free oil change.\\u0026nbsp; That\\u0026rsquo;s right a donation of $10 gets you a $30 value oil change and a 45 point courtesy check.\\u0026nbsp; Premium Auto Centers\\u0026hellip;taking care of you, your car and our community.\\u0026nbsp;\\u003c/p\\u003e\"}',78,'CreateConceptTwoPage',26,0),
(793,'{\"textArea\":\"\\u003ch1 style\\u003d\\\"text-align: center; padding-top: 2%;\\\"\\u003eProfile of Consumers\\u003c/h1\\u003e\\r\\n\\u003cp\\u003eGreat viewers!\\u003c/p\\u003e\"}',78,'ProfileOfConsumersPage',27,0),
(794,'{\"textArea\":\"\\u003ch1 style\\u003d\\\"text-align: center; padding-top: 2%;\\\"\\u003eMarketing Strategies\\u003c/h1\\u003e\\r\\n\\u003cp\\u003eTo help \\u003cstrong\\u003echange consumer attitudes \\u003c/strong\\u003eabout automotive service (a lack of trust), I would encourage you to be featured in all commercials.\\u0026nbsp; No one can better represent the trust and expertise that you offer.\\u0026nbsp; This will also highlight the benefits of local ownership backed by the national Premium brand franchise\\u003c/p\\u003e\\r\\n\\u003cp\\u003eTo \\u003cstrong\\u003eexpand your target market \\u003c/strong\\u003eto the largest potential market, focus the creative in your campaigns around the primary drivers of automotive service, which include oil changes and state inspections.\\u0026nbsp; While in the store, you can individually sell other needed services such as tires, brakes, etc.\\u003c/p\\u003e\\r\\n\\u003cp\\u003eFocus on the outstanding customer experience and the customer service guarantee that will separate yourselves from the competition.\\u0026nbsp;\\u003c/p\\u003e\\r\\n\\u003cp\\u003eTo \\u003cstrong\\u003eenhance your image in the market\\u003c/strong\\u003e, form partnerships with local non-profits in cause marketing campaigns that will make a difference in the community\\u003c/p\\u003e\\r\\n\\u003cp\\u003e1.Sponsor blood drives at your locations, whereas with a donation of blood each patron receives a free oil change.\\u0026nbsp; This provides a triple win helping to drive new donations, providing a value added for blood donors and for Midas it will increase the potential customer base while providing an outstanding community service (saving lives).\\u0026nbsp;\\u003c/p\\u003e\\r\\n\\u003cp\\u003e2.To encourage donations to the local Food Bank, consider offering a free oil change ($30 value) for every $10 donation inspection.\\u0026nbsp; This will not only help to feed hungry children, it will also promote goodwill in the community while building repeat business.\\u0026nbsp;\\u003c/p\\u003e\\r\\n\\u003cul\\u003e\\r\\n\\u003cli\\u003e\\u0026nbsp;\\u003c/li\\u003e\\r\\n\\u003c/ul\\u003e\\r\\n\\u003cp\\u003eTo attract more qualified candidates, create a recruitment campaign with your voicing, targeting candidates with the precise tech specifications you are seeking, but heavily promoting your distinct advantages (ex. higher pay, more comprehensive benefits, growth potential, etc.). Your target market is not the \\u0026ldquo;unemployed,\\u0026rdquo; but those currently working, but not totally fulfilled in their given position.\\u0026nbsp;\\u003c/p\\u003e\"}',78,'MarketingStrategiesPage',31,0),
