(816,'{\"textArea\":\"\\u003ch1 style\\u003d\\\"text-align: center; padding-top: 2%;\\\"\\u003eCreative Concepts I\\u003c/h1\\u003e\\r\\n\\u003cp\\u003eTitle:\\u003c/p\\u003e\\r\\n\\u003cp\\u003eLength:\\u003c/p\\u003e\\r\\n\\u003cp\\u003eScript:\\u003c/p\\u003e\\r\\n\\u003ctable style\\u003d\\\"table-layout: fixed;\\\"\\u003e\\r\\n\\u003cthead\\u003e\\r\\n\\u003ctr\\u003e\\r\\n\\u003cth\\u003eAudio\\u003c/th\\u003e\\r\\n\\u003cth\\u003eVideo\\u003c/th\\u003e\\r\\n\\u003c/tr\\u003e\\r\\n\\u003c/thead\\u003e\\r\\n\\u003ctbody\\u003e\\r\\n\\u003ctr\\u003e\\r\\n\\u003ctd style\\u003d\\\"word-wrap: break-word;\\\"\\u003eHi I\\u0026rsquo;m Mark Smith, owner of Premium Auto Service Centers\\u0026hellip;and each and every day our community has critical needs for more than 400 donations of blood. One donation of blood can save 3 lives. We\\u0026rsquo;ve teamed up with (local blood donation center) to help our community. From now until (date) when you donate blood you\\u0026rsquo;ll get a free oil change from Premium Auto Centers. That\\u0026rsquo;s right\\u0026hellip;give us a small amount of your fluids and we will give you ours. Go to (website) for more information on donations center hours and how to sign up. Premium Auto Centers\\u0026hellip;taking care of you, your car and our community.\\u003c/td\\u003e\\r\\n\\u003ctd style\\u003d\\\"word-wrap: break-word;\\\"\\u003eFilming Mark Smith in front of a Premium Auto Center location\\u0026hellip;starting a little further back but slowly zooming in. After the Mark Smith introduction integrate B-roll video footage of blood donation centers\\u0026hellip;coming back to Mark Smith at the close and tagline. ? ? Include Premium Auto Center locations, telephone numbers and website at the bottom of the screen throughout the full commercial. ? When referring to the donation center hours, locations and sign up include the (local donation center) website and telephone number.\\u003c/td\\u003e\\r\\n\\u003c/tr\\u003e\\r\\n\\u003c/tbody\\u003e\\r\\n\\u003c/table\\u003e\"}',80,'CreateConceptOnePage',25,0),
(817,'{\"textArea\":\"\\u003ch1 style\\u003d\\\"text-align: center; padding-top: 2%;\\\"\\u003eCreative Concepts II\\u003c/h1\\u003e\\r\\n\\u003cp\\u003eTitle:\\u003c/p\\u003e\\r\\n\\u003cp\\u003eLength:\\u003c/p\\u003e\\r\\n\\u003cp\\u003eScript:\\u003c/p\\u003e\\r\\n\\u003ctable style\\u003d\\\"table-layout: fixed;\\\"\\u003e\\r\\n\\u003cthead\\u003e\\r\\n\\u003ctr\\u003e\\r\\n\\u003cth\\u003eAudio\\u003c/th\\u003e\\r\\n\\u003cth\\u003eVideo\\u003c/th\\u003e\\r\\n\\u003c/tr\\u003e\\r\\n\\u003c/thead\\u003e\\r\\n\\u003ctbody\\u003e\\r\\n\\u003ctr\\u003e\\r\\n\\u003ctd style\\u003d\\\"word-wrap: break-word;\\\"\\u003eHi I\\u0026rsquo;m Mark Smith, owner of Premium Auto Service Centers\\u0026hellip;and each and every day our community has critical needs for more than 400 donations of blood. One donation of blood can save 3 lives. We\\u0026rsquo;ve teamed up with (local blood donation center) to help our community. From now until (date) when you donate blood you\\u0026rsquo;ll get a free oil change from Premium Auto Centers. That\\u0026rsquo;s right\\u0026hellip;give us a small amount of your fluids and we will give you ours. Go to (website) for more information on donations center hours and how to sign up. Premium Auto Centers\\u0026hellip;taking care of you, your car and our community.\\u003c/td\\u003e\\r\\n\\u003ctd style\\u003d\\\"word-wrap: break-word;\\\"\\u003eFilming Mark Smith in front of a Premium Auto Center location\\u0026hellip;starting a little further back but slowly zooming in. After the Mark Smith introduction integrate B-roll video footage of blood donation centers\\u0026hellip;coming back to Mark Smith at the close and tagline. ? ? Include Premium Auto Center locations, telephone numbers and website at the bottom of the screen throughout the full commercial. ? When referring to the donation center hours, locations and sign up include the (local donation center) website and telephone number.\\u003c/td\\u003e\\r\\n\\u003c/tr\\u003e\\r\\n\\u003c/tbody\\u003e\\r\\n\\u003c/table\\u003e\"}',80,'CreateConceptTwoPage',26,0),
(818,'{\"textArea\":\"\\u003ch1 style\\u003d\\\"text-align: center; padding-top: 2%;\\\"\\u003eProfile of Consumers\\u003c/h1\\u003e\\r\\n\\u003cp\\u003eGREAT station!\\u0026nbsp;\\u003c/p\\u003e\"}',80,'ProfileOfConsumersPage',27,0),
(819,'{\"textArea\":\"\\u003ch1 style\\u003d\\\"text-align: center; padding-top: 2%;\\\"\\u003eMarketing Strategies\\u003c/h1\\u003e\\r\\n\\u003cp\\u003eTo help \\u003cstrong\\u003echange consumer attitudes \\u003c/strong\\u003eabout automotive service (a lack of trust), I would encourage you to be featured in all commercials.\\u0026nbsp; No one can better represent the trust and expertise that you offer.\\u0026nbsp; This will also highlight the benefits of local ownership backed by the national Premium brand franchise\\u003c/p\\u003e\\r\\n\\u003cp\\u003eTo \\u003cstrong\\u003eexpand your target market \\u003c/strong\\u003eto the largest potential market, focus the creative in your campaigns around the primary drivers of automotive service, which include oil changes and state inspections.\\u0026nbsp; While in the store, you can individually sell other needed services such as tires, brakes, etc.\\u003c/p\\u003e\\r\\n\\u003cp\\u003eFocus on the outstanding customer experience and the customer service guarantee that will separate yourselves from the competition.\\u0026nbsp;\\u003c/p\\u003e\\r\\n\\u003cp\\u003eTo \\u003cstrong\\u003eenhance your image in the market\\u003c/strong\\u003e, form partnerships with local non-profits in cause marketing campaigns that will make a difference in the community\\u003c/p\\u003e\\r\\n\\u003cp\\u003e1.Sponsor blood drives at your locations, whereas with a donation of blood each patron receives a free oil change.\\u0026nbsp; This provides a triple win helping to drive new donations, providing a value added for blood donors and for Midas it will increase the potential customer base while providing an outstanding community service (saving lives).\\u0026nbsp;\\u003c/p\\u003e\\r\\n\\u003cp\\u003e2.To encourage donations to the local Food Bank, consider offering a free oil change ($30 value) for every $10 donation inspection.\\u0026nbsp; This will not only help to feed hungry children, it will also promote goodwill in the community while building repeat business.\\u0026nbsp;\\u003c/p\\u003e\"}',80,'MarketingStrategiesPage',31,0),
