(825,'{\"yearsInBusiness\":4,\"numberOfLocations\":3,\"planToExpand\":true,\"misconceptions\":\"That the service technicians do not have the technical expertise of the national shops and that Premium does not perform major repairs or factory scheduled maintenance.     \",\"sellingAdvantages\":\"Mark Smith is a hand\\u0027s on owner/operator, personally guaranteeing all work (even giving out mobile number).  All personnel are encouraged and empowered to do whatever it takes to provide an outstanding customer experience.  \",\"companyNameProjectImage\":\"As the major locally owned auto repair center, the desired image is one of caring for the customer, standing behind all their work and providing a world-class customer experience from the first call until the customer\\u0027s keys are returned.\",\"currentCompanySlogan\":\"\\\"Taking care of you, your car and the community\\\"\",\"companySloganProjectImageYes\":true}',81,'StrategicMarketingPageOne',5,0),
