r\\n\\u003ctd\\u003eWAAA\\u003c/td\\u003e\\r\\n\\u003ctd\\u003eMonday - Friday\\u003c/td\\u003e\\r\\n\\u003ctd\\u003e7pm - 12mid\\u003c/td\\u003e\\r\\n\\u003ctd\\u003e5\\u003c/td\\u003e\\r\\n\\u003c/tr\\u003e\\r\\n\\u003ctr\\u003e\\r\\n\\u003ctd\\u003eWBBB\\u003c/td\\u003e\\r\\n\\u003ctd\\u003eMonday - Friday\\u003c/td\\u003e\\r\\n\\u003ctd\\u003e6am - 7pm\\u0026nbsp;\\u003c/td\\u003e\\r\\n\\u003ctd\\u003e15\\u003c/td\\u003e\\r\\n\\u003c/tr\\u003e\\r\\n\\u003ctr\\u003e\\r\\n\\u003ctd\\u003eWBBB\\u003c/td\\u003e\\r\\n\\u003ctd\\u003eMonday - Friday\\u003c/td\\u003e\\r\\n\\u003ctd\\u003e7pm - 12mid\\u003c/td\\u003e\\r\\n\\u003ctd\\u003e5\\u003c/td\\u003e\\r\\n\\u003c/tr\\u003e\\r\\n\\u003c/tbody\\u003e\\r\\n\\u003c/table\\u003e\\r\\n\\u003c/fieldset\\u003e\\r\\n\\u003cp class\\u003d\\\"totalNumberOfCommercials\\\"\\u003e60\\u003c/p\\u003e\\r\\n\\u003cp class\\u003d\\\"weeksMonths\\\"\\u003e1\\u003c/p\\u003e\\r\\n\\u003cp class\\u003d\\\"slowPerformingMonthInvestment\\\"\\u003e$1,500\\u003c/p\\u003e\"}',116,'PlanBExcelPage',30,0),
(1105,'{\"textArea\":\"\\u003ch1 style\\u003d\\\"text-align: center; padding-top: 2%;\\\"\\u003eCreative Concepts II\\u003c/h1\\u003e\\r\\n\\u003cp\\u003eTitle: Mark Smith 2\\u003c/p\\u003e\\r\\n\\u003cp\\u003eLength: 30\\u003c/p\\u003e\\r\\n\\u003cp\\u003eScript:\\u003c/p\\u003e\\r\\n\\u003cp\\u003eHi, I\\u0026rsquo;m Mark Smith\\u0026hellip;owner of Premium Auto Centers and I recently learned that 18% of the children in our community are chronically hungry\\u0026hellip;that means that they do not know where their next meal is coming from.\\u0026nbsp; While we can\\u0026rsquo;t solve all the world\\u0026rsquo;s problems\\u0026hellip;I am committed to making a difference in our own backyard.\\u0026nbsp; That\\u0026rsquo;s why from now through (date) visit any of our 4 Premium Auto Center locations and make a $10 donation to the FoodBank and I will give you a free oil change.\\u0026nbsp; That\\u0026rsquo;s right a donation of $10 gets you a $30 value oil change and a 45 point courtesy check.\\u0026nbsp; Premium Auto Centers\\u0026hellip;taking care of you, your car and our community.\\u0026nbsp;\\u003c/p\\u003e\"}',116,'CreateConceptTwoPage',26,0),
(1106,'{\"textArea\":\"\\u003ch1 style\\u003d\\\"text-align: center; padding-top: 2%;\\\"\\u003eProfile of Consumers\\u003c/h1\\u003e\\r\\n\\u003cp\\u003eGreat Station\\u003c/p\\u003e\\r\\n\\u003cp\\u003eWonderful research\\u003c/p\\u003e\\r\\n\\u003cp\\u003ePerfect place to advertise\\u0026nbsp;\\u003c/p\\u003e\"}',116,'ProfileOfConsumersPage',27,0),
(1107,'{\"textArea\":\"\\u003ch1 style\\u003d\\\"text-align: center; padding-top: 2%;\\\"\\u003eMarketing Strategies\\u003c/h1\\u003e\\r\\n\\u003cp\\u003eTo help \\u003cstrong\\u003echange consumer attitudes \\u003c/strong\\u003eabout automotive service (a lack of trust), I would encourage you to be featured in all commercials.\\u0026nbsp; No one can better represent the trust and expertise that you offer.\\u0026nbsp; This will also highlight the benefits of local ownership backed by the national Premium brand franchise\\u003c/p\\u003e\\r\\n\\u003cp\\u003eTo \\u003cstrong\\u003eexpand your target market \\u003c/strong\\u003eto the largest potential market, focus the creative in your campaigns around the primary drivers of automotive service, which include oil changes and state inspections.\\u0026nbsp; While in the store, you can individually sell other needed services such as tires, brakes, etc.\\u003c/p\\u003e\\r\\n\\u003cp\\u003eFocus on the outstanding customer experience and the customer service guarantee that will separate yourselves from the competition.\\u0026nbsp;\\u003c/p\\u003e\\r\\n\\u003cp\\u003eTo \\u003cstrong\\u003eenhance your image in the market\\u003c/strong\\u003e, form partnerships with local non-profits in cause marketing campaigns that will make a difference in the community\\u003c/p\\u003e\\r\\n\\u003cp\\u003e1.Sponsor blood drives at your locations, whereas with a donation of blood each patron receives a free oil change.\\u0026nbsp; This provides a triple win helping to drive new donations, providing a value added for blood donors and for Midas it will increase the potential customer base while providing an outstanding community service (saving lives).\\u0026nbsp;\\u003c/p\\u003e\\r\\n\\u003cp\\u003e2.To encourage donations to the local Food Bank, consider offering a free oil change ($30 value) for every $10 donation inspection.\\u0026nbsp; This will not only help to feed hungry children, it will also promote goodwill in the community while building repeat business.\\u003c/p\\u003e\\r\\n\\u003cp\\u003eTo attract more qualified candidates, create a recruitment campaign with your voicing, targeting candidates with the precise tech specifications you are seeking, but heavily promoting your distinct advantages (ex. higher pay, more comprehensive benefits, growth potential, etc.). Your target market is not the \\u0026ldquo;unemployed,\\u0026rdquo; but those currently working, but not totally fulfilled in their given position.\\u0026nbsp;\\u003c/p\\u003e\"}',116,'MarketingStrategiesPage',31,0),
