(1111,'{\"firstTierBusiness\":\"Safelight\",\"secondTierBusiness\":\"Ace Glass \",\"thirdTierBusiness\":\"Discount Glass\",\"fourthTierBusiness\":\"\",\"competitionA\":\"Safelight\",\"competitionB\":\"Ace Glass \",\"competitionStrengthA\":\"Safelight is affiliated with the insurance companies including Progressive, Nationwide, Liberty Mutual, USAA, Allstate and Harleysville.  \",\"competitionStrengthB\":\"Ace is locally owned and has a very good location off Midlothian Turnpike. \",\"competitionWeaknessA\":\"While a very large company, Safelite has a reputation of poor workmanship because of high productivity goals.  In addition, add-ons are stressed. \",\"competitionWeaknessB\":\"Ace has had 3 or 4 different owners in last 10 years.  Current owner has a reputation of not being friendly.  Ethics are questioned. \"}',117,'MarketPlaceCompetitionPage',3,0),
