(1113,'{\"yearsInBusiness\":50,\"numberOfLocations\":1,\"planToExpand\":false,\"misconceptions\":\"All auto glass companies are created equal, which is not the case.  Many of the national glass installers only care about volume.  While their is little differentiation between the quality of the glass, there is a difference in the installation.  Many of the volume-based national companies take shortcuts.  Recalibrations are widely misunderstood. \",\"sellingAdvantages\":\"Smiley\\u0027s Glass is a \\\"one-stop shop,\\\" including calling the insurance agent, get billing authorization, schedule the install and billing the insurance agency directly...taking care of all the details so you don\\u0027t have to.  In addition, Smiley\\u0027s is AGSC certified and offers an unconditional guarantee that it will be fixed right at OEM standards. \",\"companyNameProjectImage\":\"Smiley\\u0027s is not an ordinary glass shop, instead providing an extraordinary customer experience (The Ukrops of glass shops).  As a locally owned business, you live here in the community, support local causes and most importantly are personally available if ever there are problems. \",\"currentCompanySlogan\":\"Safety...Satisfaction...Smiley\\u0027s \",\"companySloganProjectImageYes\":true}',117,'StrategicMarketingPageOne',5,0),
