(1132,'{\"textArea\":\"\\u003ch1 style\\u003d\\\"text-align: center; padding-top: 2%;\\\"\\u003eMarketing Strategies\\u003c/h1\\u003e\\r\\n\\u003cp\\u003eTo keep continuity and to effectively communicate the local ownership message and installation guarantee, it is recommended that Sandra continue to be the \\u003cem\\u003evoice\\u003c/em\\u003e of Smiley\\u0027s Glass with a direct-to-consumer educational campaign designed to answer frequently asked questions and change consumer attitudes about automotive glass companies.\\u003c/p\\u003e\\r\\n\\u003cp\\u003ePotential creative strategies\\u0026hellip;\\u003c/p\\u003e\\r\\n\\u003cul\\u003e\\r\\n\\u003cli\\u003eSmiley\\u0027s Glass is a \\\"one-stop shop,\\\" including calling the insurance agent, getting billing authorization, scheduling the install and billing the insurance agency directly...taking care of all the details so you don\\u0027t have to.\\u0026nbsp;\\u003c/li\\u003e\\r\\n\\u003cli\\u003eExplain what recalibration is and the difference between lane departure warning and blind-spot monitoring.\\u0026nbsp; All forward-facing cameras need to be exactly recalibrated to the new glass for accuracy. Smiley\\u0026rsquo;s conducts a pre-scan and a post-scan.\\u0026nbsp;\\u003c/li\\u003e\\r\\n\\u003cli\\u003eOne of the most important repairs you will ever perform on your vehicle is a front windshield replacement.\\u003c/li\\u003e\\r\\n\\u003cli\\u003eAs a mother of young kids spending so much time in your car, continue to humanize the automotive glass safety concern.\\u003c/li\\u003e\\r\\n\\u003cli\\u003eBefore replacing your windshield, make sure the company follows the AUTO GLASS SAFETY COUNCIL\\u0026rsquo;S (AGSC) safety standard and will be fixed right at OEM standards.\\u0026nbsp;\\u003c/li\\u003e\\r\\n\\u003cli\\u003eSmiley\\u0026rsquo;s Glass is locally owned and has been in the glass replacement and repair business for 58 years.\\u003c/li\\u003e\\r\\n\\u003cli\\u003eWhile the national companies care mainly about the \\u003cem\\u003equantity \\u003c/em\\u003eof installations, Smiley\\u0027s mission is to ensure \\u003cem\\u003equality\\u003c/em\\u003e and \\u003cem\\u003esafety \\u003c/em\\u003e(quantity will follow).\\u003c/li\\u003e\\r\\n\\u003cli\\u003eEducate on the potential problems associated with a shoddy glass installation (i.e. airbags not deploying, potential roof collapse, etc.)\\u003c/li\\u003e\\r\\n\\u003cli\\u003eHighlight Smiley\\u0026rsquo;s unconditional guarantee on all workmanship\\u003c/li\\u003e\\r\\n\\u003cli\\u003eEducate consumers that they have a choice in automotive glass replacement, and to insist on Smiley\\u0026rsquo;s Glass (even though insurance companies may try to steer you to another company).\\u003c/li\\u003e\\r\\n\\u003cli\\u003eIf customers to need reach the local owner\\u0026hellip;Steve is available.\\u0026nbsp;\\u003c/li\\u003e\\r\\n\\u003c/ul\\u003e\\r\\n\\u003cp\\u003e\\u0026nbsp;\\u003c/p\\u003e\"}',117,'MarketingStrategiesPage',31,0),
